import React from "react";
import styled from "styled-components";
import palette from "../../lib/styles/palette";
import BgSection from "../common/BgSection";
import Button from "../common/Button";

const Head = () => {
  return (
    <BgSection bgName="main-bg4">
      <div>
        <Title>About</Title>
      </div>
      <ButtonBox>
        <Button
          to={{
            pathname:
              "https://www.notion.so/yoonvelop/Hyebin-Yoon-c06bf6b603034b38872610b1e4b4c5c0",
          }}
          target="_blank"
        >
          Resume
        </Button>
        <Button
          to={{
            pathname: "https://github.com/yoonvelop",
          }}
          target="_blank"
        >
          GitHub
        </Button>
        <Button target="_blank" to="https://velog.io/@yoonvelop">
          Velog
        </Button>
      </ButtonBox>
    </BgSection>
  );
};
const Title = styled.h1`
  color: ${palette.white};
  font-size: 2.5rem;
  font-weight: 600;
  margin: 0rem 0;

  & > span {
    font-weight: 500;
    font-size: 2.2rem;
  }
`;
const ButtonBox = styled.div`
  display: flex;
`;
export default Head;
